import React , {useEffect, useState} from 'react'
import Todo from './sec/Todo'
import Doing from './sec/Doing'
import Done from './sec/Done'
import "./Homepage.css"
import axios from 'axios'
import { Link , useHistory} from 'react-router-dom'
import Header from '../components/navbar/Header'


const Homepage = () => {
  const history = useHistory();


  axios.defaults.withCredentials = true;

  const [loginStatus,setLoginStatus] = useState()

  useEffect(()=>{
    axios.get("http://localhost:5000/api/login").then((response)=>{
      if (response.data.loggedIn === true) {
        setLoginStatus(response.data.user[0].username)
      }
    })
  }, [])
  return (
    <div>
    <div>
      <Header />
    <h3 style={{marginLeft: "20px",marginRight: "20px",fontWeight: "bold"}}>User: {loginStatus}</h3>
    </div>
      <div>
        <Done/>
        <Todo/>
        <Doing/>
      </div>
    </div>
  )
}

export default (Homepage);
